//หน้าเริ่มต้น
import React, { Component } from 'react';
import './Home.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import { Card, CardText, CardTitle, CardSubtitle, Button } from 'reactstrap';
import Header from '../Header/Header';
 import Content from '../Home/Content/Content'
// import Service from './Content/Service'
// import Footer from '../Footer/Footer'
// import Allowance from './Content/Allowance';


class Home extends Component {
    render() {
        return (
            <div>
                <Card className="BG " >
                    <Header />
                   
                    <div class="container top front">
                        <div className="row">
                            <div className="col-lg-3 col-sm-12">
                            </div>

                            <div className="col-lg-6 col-sm-12 d-none d-lg-block">
                                <CardTitle><h1>Elderly DataBase</h1></CardTitle>
                                <CardSubtitle>เว็บไซต์เเสดงจำนวนประชากร เเละข่าวสารเกี่ยวกับผู้สูงอายุ</CardSubtitle><br/>
                                <a href="/App" className="btn btn-primary btn-md active button "  role="button" aria-pressed="true"><h5 className= "front">เข้าสู่เว็บไซต์</h5></a>
                            </div>

                            <div className="col-lg-3 col-sm-12">
                            </div>

                        </div>
                    </div>
                    <br/>
                </Card>
               

            </div>
        )

    }
}
export default Home;

